import {Link}
  from "react-router-dom";

function HelloWorld() {
    return(
        <div>
            <Link to="/">Lab</Link> |
            <Link to="/hello">Hello</Link> |
            <Link to="/tuiter">Tuiter</Link>
            <h1>Hello World!</h1>
       </div>
    );
 };
 export default HelloWorld;
